import React, { Fragment } from 'react';
import { Dimmer, Icon, Image, Loader } from 'semantic-ui-react';

export default function NavBar() {
	return (
		<Fragment>
			<div>
				<Dimmer active>
					<Loader>Loading</Loader>
				</Dimmer>
				<Icon loading name="spinner" />
			</div>
		</Fragment>
	);
}
